webpackJsonp([0x642c0d549eb98800],{"./node_modules/json-loader/index.js!./.cache/json/miscellaneous-removing-all-locally-stored-challenges.json":function(e,l){e.exports={data:{markdownRemark:{html:"<p>Removing all your locally stored challenges will solve many problems related to the browser crashing on FreeCodeCamp</p>\n<p>In Chrome:</p>\n<ul>\n<li>\n<p>On <a href='https://freecodecamp.com' target='_blank' rel='nofollow'>freecodecamp</a> open your console</p>\n<ul>\n<li>Windows: <code>Ctrl</code> + <code>Shift</code> + <code>J</code></li>\n<li>Mac OS: <code>Cmd</code> + <code>Opt</code> + <code>J</code></li>\n</ul>\n</li>\n<li>\n<p>Go to resources tab(chrome).</p>\n<ul>\n<li>There click on the “Local Storage” link in the nav bar on the right.</li>\n</ul>\n</li>\n<li>Delete all the entries on the right side, or run this command in your browser’s console to clear all entries from your localStorage: <code>localStorage.clear();</code></li>\n<li>See if this solves your issue</li>\n</ul>\n<p><img src=\"//discourse-user-assets.s3.amazonaws.com/original/2X/9/9ea6a9cf48282cbf2aa766a6aa5ce59218c80528.png\"></p>\n<p>Alternatively, if you are having issues with a specific challenge freezing your browser, <a href='http://forum.freecodecamp.com/t/clear-specific-values-from-your-browser-local-storage/19128' target='_blank' rel='nofollow'>find the name of that challenge in local storage and delete just that one</a>.</p>",fields:{slug:"/miscellaneous/removing-all-locally-stored-challenges/"},frontmatter:{title:"Removing All Locally Stored Challenges"}}},pathContext:{slug:"/miscellaneous/removing-all-locally-stored-challenges/"}}}});
